import './App.css';
import { BrowserRouter,Switch,Route } from 'react-router-dom'
import Store from './pages/Store'
import Product from './pages/Product'
import MotherDay from './pages/MotherDay'

function App() {
  return (
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={Store} />
      <Route path="/product/:productId" component={Product} />
      <Route path="/motherday" component={MotherDay} />
      <Route path="/sale" component={Store} />
      <Route path="/egg" component={Store} />
      <Route path="/cake" component={Store} />
      <Route path="/jelly" component={Store} />
    </Switch>
  </BrowserRouter>
  );
}

export default App;
